import { NavLink } from 'react-router-dom';
import NavStyles from '../styles/nav.module.css';

const Navigation = () => {
  return (
    <>
      <nav>
            <NavLink to="/" className={NavStyles.navLinks}>HOME</NavLink>
            <NavLink to="/menuitem" className={NavStyles.navLinks}>MENU ITEM</NavLink>
            <NavLink className={NavStyles.navLinks}>ALLERGENS</NavLink>
            <NavLink className={NavStyles.navLinks}>INGREDIENTS</NavLink>
            <NavLink className={NavStyles.navLinks}>NUTRITIONAL INFORMATION</NavLink>
      </nav>
    </>
  );
}

export default Navigation;
